sshd:
  packages:
    []
  config_directory:
    /etc/ssh
  services:
    - sshd

  ## eliminate key exchange protocols that use NIST curves, have too
  ## small a DH modulus, or use an insecure hash function, while still
  ## maintaining a degree of backward compatibility
  KexAlgorithms:
    - curve25519-sha256@libssh.org
    - diffie-hellman-group-exchange-sha256

  ## disable the DSA and ECDSA server authentication algorithms, which
  ## depend on the quality/integrity of the PRNG; DSA also requires
  ## 1024-bit keys, which are too small
  HostKey:
    - /etc/ssh/ssh_host_ed25519_key
    - /etc/ssh/ssh_host_rsa_key

  ## explicitly disable the old, broken SSHv1 protocol
  Protocol: 2

  ## explicitly disable password authentication and enable public key
  ## authentication (note that ChallengeResponseAuthentication must be
  ## enabled if using a PAM-based OTP mechanism)
  PasswordAuthentication: no
  ChallengeResponseAuthentication: no
  PubkeyAuthentication: yes

  ## restrict remote access to the designated users or groups
  #AllowGroups: ssh-user

  ## eliminate broken ciphers, key sizes less than 128 bits, and block
  ## ciphers with block sizes smaller than 128 bits; prefer
  ## AE modes but allow CTR for backwards compatibility (CTR with
  ## Encrypt-then-MAC is provably secure), and prefer
  ## ChaCha20+Poly1305 over the others because it encrypts message
  ## sizes (which prevents certain kinds of encrypted traffic analysis
  ## attacks)
  Ciphers:
    - chacha20-poly1305@openssh.com
    - aes256-gcm@openssh.com
    - aes128-gcm@openssh.com
    - aes256-ctr
    - aes192-ctr
    - aes128-ctr

  ## only use Encrypt-then-MAC with strong hash algorithms; also
  ## enforce minimum tag and key sizes of 128 bits
  MACs:
    - hmac-sha2-512-etm@openssh.com
    - hmac-sha2-256-etm@openssh.com
    - hmac-ripemd160-etm@openssh.com
    - umac-128-etm@openssh.com
    - hmac-sha2-512
    - hmac-sha2-256
    - hmac-ripemd160
    - umac-128@openssh.com

  Subsystem:
    - sftp /usr/libexec/sftp-server

  ## the OpenBSD DH-GEx moduli list filtered to remove those smaller
  ## than 2000 bits
